const keywords = $input.item.json.tasks[0].result.map(rst => ({
  keyword: rst.keyword,
  search_volume: rst.search_volume,
  cpc: rst.cpc,
  competition: rst.competition
}));

return keywords;

// Prepare data for GPT
const keywordData = $input.all().map(item => {
  return {
    keyword: item.json.keyword,
    volume: item.json.search_volume,
    cpc: item.json.cpc,
    competition: item.json.competition,
  };
});

return [{ json: { keywordData: JSON.stringify(keywordData) } }];
